import React, { Component } from 'react';
import ClassList from './components/ClassList';
import ScheduleList from './components/ScheduleList';
import uuid from 'uuid';

import './App.css';

class App extends Component {

    state = {
        classes: [
            {
                id: uuid(),
                classTitle: 'cs 701: Senior Seminar',
                classDescription: 'this is a class for seniors.',
                saved: false
            },
            {
                id: uuid(),
                classTitle: 'cs 702: Thesis',
                classDescription: 'this is a class for seniors who want to write a thesis.',
                saved: false
            }
        ]
    }

    render() {
        console.log(this.state.classes)
        return (
          <div className="App">
            <h1>Welcome</h1>
            <ClassList classes={this.state.classes}/>
          </div>
        );
    }
}

export default App;
